import React, { useEffect, useState } from "react";
import { useHistory } from "react-router-dom";
import Header from "./Header";
import Footer from "./Footer";
import "../style/SignUp.scss";
import "../style/CompleteDetails.scss";
import "../style/App.scss";
// icons
import iconDown from "../icons/chevrons-down.svg";

const CompleteDetails = (props) => {
  useEffect(() => {
    window.scrollTo(0, 0);
  }, []);
  const history = useHistory();
  return (
    <div className="App">
      <Header />
      <div className="Find">
        <div className="full">
          <h1>Find Your Ideal Employer</h1>
          <p className="description">
            Seeking for a suitable family to work for? We strive to help you
            find you the most suitable employer.
          </p>
          <a className="findButton" onClick={() => history.push("/signup")}>
            FIND EMPLOYER{" "}
            <span style={{ color: "#ed721d", fontWeight: "900" }}>NOW</span>
          </a>
        </div>
      </div>
      <Footer />
    </div>
  );
};

export default CompleteDetails;
